import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

const PredictionResult = ({ prediction }) => {
  if (!prediction) return null;

  const recommendations = Array.isArray(prediction.recommendations) 
    ? prediction.recommendations 
    : [prediction.recommendations];

  const getProbabilityClass = (confidence) => {
    if (confidence < 50) return 'probability-low-single';
    if (confidence < 75) return 'probability-medium-single';
    return 'probability-high-single';
  };

  const confidenceValue = Array.isArray(prediction.confidence) 
    ? prediction.confidence[0] 
    : prediction.confidence;

  const confidence = Math.round(confidenceValue * 100);
  const probabilityClass = getProbabilityClass(confidence);

  return (
    <Box sx={{ mt: 4 }}>
      <Paper elevation={3} sx={{ p: 3, borderRadius: 2 }}>
        <Typography variant="h5" gutterBottom>
          Analyse-Ergebnisse
        </Typography>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6" color="primary" gutterBottom>
            Wechselwahrscheinlichkeit
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
            <Typography variant="h3" sx={{ color: '#001B41', mr: 2 }}>
              {confidence}%
            </Typography>
            <Box sx={{ flex: 1, position: 'relative', height: '12px', mr: 2 }}>
              <Box
                sx={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  height: '100%',
                  width: '100%',
                  bgcolor: '#f0f0f0',
                  borderRadius: '6px',
                  overflow: 'hidden',
                }}
              />
              <Box
                sx={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  height: '100%',
                  width: `${confidence}%`,
                  bgcolor: probabilityClass === 'probability-low-single' ? '#dc3545' :
                          probabilityClass === 'probability-medium-single' ? '#ffc107' : '#28a745',
                  borderRadius: '6px',
                  transition: 'width 0.3s ease',
                }}
              />
            </Box>
          </Box>
          <Typography variant="body2" color="text.secondary">
            {prediction.status}
          </Typography>
        </Box>

        <Box sx={{ mb: 3 }}>
          <Typography variant="h6" color="primary" gutterBottom>
            Empfehlungen
          </Typography>
          <Box component="ul" sx={{ listStyle: 'none', p: 0, m: 0 }}>
            {recommendations && recommendations.length > 0 ? (
              recommendations.map((rec, index) => (
                <Box
                  component="li"
                  key={index}
                  sx={{
                    p: '12px 15px',
                    bgcolor: '#f5f5f5',
                    borderRadius: '8px',
                    mb: 1,
                    fontSize: '0.95rem',
                    color: '#666',
                    '&:last-child': { mb: 0 }
                  }}
                >
                  {rec}
                </Box>
              ))
            ) : (
              <Box
                component="li"
                sx={{
                  p: '12px 15px',
                  bgcolor: '#f5f5f5',
                  borderRadius: '8px',
                  fontSize: '0.95rem',
                  color: '#666'
                }}
              >
                Keine Empfehlungen verfügbar
              </Box>
            )}
          </Box>
        </Box>

        {prediction.explanations && prediction.explanations.length > 0 && (
          <Box>
            <Typography variant="h6" color="primary" gutterBottom sx={{ mb: 1 }}>
              Wichtigste Einflussfaktoren
            </Typography>
            {prediction.explanations.map((feature, index) => (
              <Box key={index} sx={{ mb: 1.2, pl: 1 }}>
                <Typography variant="subtitle2" sx={{ fontWeight: 600, fontSize: '1rem', color: '#1a1a1a' }}>
                  {feature.feature} <span style={{ color: '#666', fontWeight: 400 }}>({feature.impact_percentage.toFixed(1)}%)</span>
                </Typography>
                <Typography variant="body2" color="text.secondary" sx={{ fontSize: '0.95rem', ml: 0.5 }}>
                  {feature.description}
                </Typography>
              </Box>
            ))}
          </Box>
        )}
      </Paper>
    </Box>
  );
};

export default PredictionResult;
